// src/pages/AdminList.jsx
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function AdminList() {
  const [admins, setAdmins] = useState([]);

  useEffect(() => {
    api.get('/admins')
      .then(response => setAdmins(response.data))
      .catch(error => console.error('Erro ao buscar admins:', error));
  }, []);

  return (
    <div className="container my-5">
      <h2>Admins Cadastrados</h2>
      <Link to="/" className="btn btn-secondary mb-3">← Voltar à Início</Link>
      <Link to="/admins/novo" className="btn btn-primary mb-3 ms-3">+ Cadastrar Novo Admin</Link>

      <ul className="list-group">
        {admins.map(admin => (
          <li key={admin._id} className="list-group-item">
            <strong>{admin.nome}</strong> – {admin.email} ({admin.nivelAcesso})
          </li>
        ))}
      </ul>
    </div>
  );
}
